// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.10;

import "@openzeppelin/contracts/access/Ownable.sol";

contract GridFirePayment is Ownable {
    uint256 private feePercent = 5;
    uint256 private ownerBalance = 0;
    mapping(address => uint256) balances;

    event NewPurchase(address buyer, uint256 artistShare);

    function creditArtist(address _artist) private {
        uint256 artistShare = msg.value;
        require(artistShare != 0);

        if (feePercent == 0) {
            balances[_artist] += msg.value;
        } else {
            uint256 serviceFee = (msg.value * feePercent) / 100;
            artistShare = msg.value - serviceFee;
            balances[_artist] += artistShare;
            ownerBalance += serviceFee;
        }

        emit NewPurchase(msg.sender, artistShare);
    }

    function purchase(address _artist, uint256 _releasePrice) public payable {
        require(msg.value != 0 && msg.value >= _releasePrice);
        creditArtist(_artist);
    }

    function getBalance(address _artist) public view returns (uint256) {
        return balances[_artist];
    }

    function claim() public {
        uint256 amount = balances[msg.sender];
        require(amount != 0, "Nothing to claim.");
        require(address(this).balance >= amount);
        balances[msg.sender] = 0;
        payable(msg.sender).transfer(amount);
    }

    function setServiceFee(uint256 newFee) public onlyOwner {
        require(newFee < 100);
        feePercent = newFee;
    }

    function getOwnerBalance() public view returns (uint256) {
        return ownerBalance;
    }

    function withdrawOwnerBalance() public onlyOwner {
        require(ownerBalance != 0);
        uint256 amount = ownerBalance;
        ownerBalance = 0;
        payable(msg.sender).transfer(amount);
    }
}
